for key in settings:
    try:
        if key not in help:
            print('Missing {}["{}"]'.format(level, key))
            self.undoc = True
            continue
        if type(settings[key]) is str:
            continue
        sublevel = '{}["{}"]'.format(level, key)
        self.TestALevel(settings[key], help[key], sublevel)
    except TypeError:
        print('Error on {}["{}"]'.format(level, key))
        self.undoc = True
